Promotional info - &quot;Patricia Briggs' adventures of coyote shapeshifter Mercy Thompson in Moon Called, Blood Bound and Iron Kissed, topped the New York Times best-seller list. Now Mercy comes to comics in an all-new adventure created by the author! Mercy Thompson observes the supernatural community while standing apart from it; between the things that go bump in the night and the things that bump right back. This prequel to the best-selling novels finds Mercy smack in the middle of warring packs of werewolves and face-to-face with angry vampires. Worse still, she faces the dreaded... job interview!&quot;

